import React, { useState } from "react";
import BasicPlans from "./components/basic/BasicPlans";
import PremiumPlans from "./components/premium/PremiumPlans";
import SuperPremiumPlans from "./components/superpremium/SuperPremiumPlans";

const Subscription = () => {
  const [check, setcheck] = useState("01");
  const plans = [
    {
      id: "01",
      name: "Basic Plans",
      img: "data:image/png;base64,",
    },
    {
      id: "02",
      name: "Premium Plans",
      img: "data:image/png;base64,",
    },
    {
      id: "03",
      name: "Super Premium Plans",
      img: "data:image/png;base64,",
    },
  ];
  return (
    <div className="bgwhite border-d mtpx9 cust-scroll p20">
      <div className="">
        <h5 className="fsize20 textprimary mtpx1 mbpx1 font-600">
          Subscription
        </h5>
        <div className="mtpx18 grid-cols-5 gap-12 rounded-10">
          {plans.map((e) => (
            <div
              className={
                check === e.id
                  ? "p20 bgprimary d-shadow rounded-10 cursor-pointer"
                  : "p20 bgwhite d-shadow rounded-10 cursor-pointer"
              }
              onClick={() => setcheck(e.id)}
            >
              <img src={e.img} alt="cms" className="cms-img object-contain" />
              <p
                className={
                  check === e.id
                    ? "fsize14 textwhite font-300 mtpx8 text-center"
                    : "fsize14 textforth font-300 mtpx8 text-center"
                }
              >
                {e.name}
              </p>
            </div>
          ))}
        </div>
        <div>
          {check === "01" ? (
            <>
              <div>
                <BasicPlans />
              </div>
            </>
          ) : null}
          {check === "02" ? (
            <>
              <div>
                <PremiumPlans />
              </div>
            </>
          ) : null}
          {check === "03" ? (
            <>
              <div>
                <SuperPremiumPlans />
              </div>
            </>
          ) : null}
        </div>
      </div>
    </div>
  );
};

export default Subscription;
